import React, { Component } from 'react';

class DataView extends Component {
    constructor(props) {
        super(props);
      }
    render() { 

        const visible = this.props.visible

         return(
            <div>
                {
                    visible 
                    ?<div>
                        <p>dataview showing</p>
                    </div>
                    :<div></div>
                }
            </div>
         )
    }
}
 
export default DataView;
